import React from "react";

const Icon = (props) => {
  const { title, onClick, id, className } = props;
  return (
    <i
      title={props.title}
      aria-hidden="true"
      style={{ cursor: "pointer" }}
      onClick={props.onClick}
      id={props.id}
      className={props.className}
    ></i>
  );
};

export default Icon;
